import logo from './logo.svg';
import './App.css';

function App() {
  const handleImageClick = () => {
    alert('click')
  }

  const handleLinkClick = () => {
    alert("link");
  }

  return (
    <div className="App">
      <header className="App-header">
        <img onClick={handleImageClick} src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
          onClick={handleLinkClick}
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
